 des supports cohérents et impactants, adaptés aux besoins des projets et des utilisateurs.\\n\\nPassion, exigence et envie d’apprendre me guident au quotidien. Curieux et motivé, j’aime relever de nouveaux défis, explorer les outils créatifs (Figma, WordPress, suite Adobe) et travailler en équipe pour faire émerger des projets qui ont du sens.\", \"Adresse\": \"4 Rue des Salorges 44100 Nantes\", \"Site_web\": \"https://uppercaze.fr\", \"Telephone\": \"06 46 09 35 42\", \"View_mail\": true, \"View_adresse\": true, \"View_site_web\": true, \"View_naissance\": true, \"View_telephone\": true, \"Photo_de_profil\": \"c656ef79-2709-4812-b170-0f15c9a6d1a5\", \"Date_de_naissance\": \"1997-08-06\"}','{\"Resume\": \"D’un chantier à l’autre, j’ai troqué le marteau pour la souris. Fort de plusieurs expériences dans le bâtiment et l’industrie, j’ai choisi de mettre mon énergie et ma créativité au service du design graphique et du web.\\n\\nAujourd’hui, je conçois et réalise des visuels web et print pensés pour marquer les esprits, en alliant sens esthétique, rigueur technique et souci du détail. De l’identité visuelle à l’UX/UI design, je m’attache à donner vie à des supports cohérents et impactants, adaptés aux besoins des projets et des utilisateurs.\\n\\nPassion, exigence et envie d’apprendre me guident au quotidien. Curieux et motivé, j’aime relever de nouveaux défis, explorer les outils créatifs (Figma, WordPress, suite Adobe) et travailler en équipe pour faire émerger des projets qui ont du sens.\"}',NULL,NULL),(1042,1114,'Profil','1','{\"id\": 1, \"Nom\": \"Matias\", \"Mail\": \"jordan.matiassoares@gmail.com\", \"Poste\": \"Graphiste & Webdesigner\", \"Prenom\": \"Jordan\", \"Resume\": \"D’un chantier à l’autre, j’ai troqué le marteau pour la souris. Fort de plusieurs expériences dans le bâtiment et l’industrie, j’ai choisi de mettre mon énergie et ma créativité au service du design graphique et du web.\\n\\nAujourd’hui, je conçois et réalise des visuels web et print pens