INSERT INTO `Emplois` VALUES (1,'Terminé','2025-08-27 11:48:04','2025-08-27 16:09:13','Aide-Maçon',1,'2012-08-01','2014-08-01','Participation aux chantiers de construction et de rénovation :\n	•	Préparation et manutention des matériaux (béton, briques, parpaings, mortier).\n	•	Assistance aux maçons dans les travaux de coffrage, montage de murs et finitions.\n	•	Respect des consignes de sécurité et entretien du matériel.\n	•	Découverte du travail en équipe sur chantier et acquisition de rigueur et d’endurance.','CDD'),(2,'Terminé','2025-08-27 12:17:46','2025-08-27 16:09:10','Isolateur',2,'2017-04-01','2017-05-01','Missions réalisées :\n	•	Isolation thermique des combles (pose et soufflage de matériaux isolants).\n	•	Évacuation et remplacement d’anciennes isolations.\n	•	Préparation et entretien du chantier, respect des consignes de sécurité.','CDD'),(3,'Terminé','2025-08-27 13:27:51','2025-08-27 16:09:06','Agent Manutentionnaire',3,'2017-06-01','2017-08-01','Missions réalisées :\n	•	Relevé et consignation de mesures techniques sur les voies ferrées.\n	•	Assistance logistique et manutention du matériel de mesure.\n	•	Travail en horaires décalés et de nuit dans un environnement ferroviaire.','CDD'),(4,'Terminé','2025-08-27 13:37:52','2025-08-27 16:09:02','Ouvrier en Usine',4,'2017-11-01','2018-04-01','Missions réalisées :\n	•	Démoulage et contrôle de pièces en caoutchouc issues de presses industrielles.\n	•	Travail en équipe en horaires postés (2x8).\n	•	Respect des consignes de sécurité et suivi de la cadence de production.','CDD'),(5,'Terminé','2025-08-27 13:46:58','2025-08-27 16:08:58','Laborantin',5,'2018-05-01','2018-09-01','Missions réalisées :\n	•	Réception, identification et préparation des échantillons de matières premières.\n	•	Réalisation d’analyses physico-chimiques, notamment par spectrophotométrie.\n	•	Rédaction, gestion et archivage de dossiers liés aux contrôles de qualité.\n	•	Application stricte des normes d’hygiène, de traçabilité et de sécurité en laboratoire.','CDD'),(6,'Terminé','2025-08-27 15:40:42','2025-08-27 16:07:32','Maçon',6,'2019-05-01','2019-08-01','Missions réalisées :\n	•	Construction et aménagement de piscines.\n	•	Pose de carrelages et finitions murales/sols.\n	•	Travaux complémentaires en électricité et plomberie.\n	•	Participation à l’ensemble des étapes d’un chantier, de la préparation à la finition.','CDD'),(7,'Terminé','2025-08-27 15:46:33','2025-08-27 16:20:14','Bancheur/Maçon',7,'2020-06-01','2021-05-01','Missions réalisées :\n	•	Lecture et suivi précis des plans de chantier.\n	•	Travail sur différents sites, nécessitant des déplacements fréquents.\n	•	Réalisation de finitions avec rigueur et minutie.\n	•	Collaboration avec l’équipe pour assurer la qualité et le respect des délais.','CDD'),(8,'Terminé','2025-08-27 15:49:00','2025-08-27 16:20:42','Maçon',8,'2021-06-01','2021-07-01','Missions réalisées :\n	•	Lecture et suivi précis des plans de chantier.\n	•	Adaptation rapide pour résoudre les problèmes rencontrés sur le terrain.\n	•	Participation aux différentes étapes de construction et travaux de finition.\n	•	Collaboration avec l’équipe pour assurer la qualité et le respect des délais.','CDD'),(9,'Terminé','2025-08-27 15:57:29','2025-08-28 10:50:52','Graphiste/Webdesigner',9,'2023-01-01','2024-05-01','Participation à la création et à la réalisation de supports visuels print\net web. Conception de maquettes graphiques, réalisation de visuels\npour les réseaux sociaux, création d’éléments graphiques respectant\nla charte de l’entreprise. Travail en équipe pour assurer la cohérence\nvisuelle des projets et contribution à la mise en page de documents\ndestinés à la communication print et digitale.','Alternance'),(10,'Terminé','2025-08-27 15:59:52','2025-08-28 10:49:27','Formateur UI Design',10,'2024-06-01','2024-10-01','Animation de cours en design d’interface pour des apprenants\nen reconversion ou en formation initiale. Enseignement des\nfondamentaux du design graphique, de l’UX/UI, de la conception de\nmaquettes sur Figma et des bases du développement web avec\nHTML et CSS. Suivi pédagogique individualisé, encadrement de projets\npratiques et accompagnement vers la professionnalisation.','CDD'),(11,'En Cours','2025-08-27 16:01:46','2025-08-28 10:52:33','Graphiste/Webdesigner',11,'2024-11-01',NULL,'Conception d’identités visuelles et d’interfaces web sur mesure pour\nindépendants et petites entreprises. Réalisation de maquettes UI/\nUX web et mobile, création de chartes graphiques, logos et supports\nprint. Intégration WordPress et accompagnement client en direction\nartistique et suivi de projet.','Freelance'),(12,'Terminé','2025-08-27 16:23:50','2025-08-28 10:46:25','Maçon',12,'2021-08-01','2021-12-01','Missions réalisées :\n	•	Lecture et suivi précis des plans de chantier.\n	•	Adaptation rapide pour résoudre les problèmes rencontrés sur le terrain.\n	•	Participation aux différentes étapes de construction et travaux de finition.\n	•	Collaboration avec l’équipe pour assurer la qualité et le respect des délais.','CDD'),(13,'Terminé','2025-08-28 10:53:40','2025-08-28 10:54:35','Graphiste',11,'2022-01-01','2022-12-01',NULL,'Freelance');
/*!40000 ALTER TABLE `Emplois` ENABLE KEYS */;
