INSERT INTO `Profil` VALUES (1,'Matias','Jordan','Graphiste & Webdesigner','4 Rue des Salorges, 44100 Nantes','c656ef79-2709-4812-b170-0f15c9a6d1a5',1,1,'jordan.matiassoares@gmail.com','06 46 09 35 42',1,1,'https://uppercaze.fr',1,'1997-08-06','D’un chantier à l’autre, j’ai troqué le marteau pour la souris. Fort de plusieurs expériences dans le bâtiment et l’industrie, j’ai choisi de mettre mon énergie et ma créativité au service du design graphique et du web.\n\nAujourd’hui, je conçois et réalise des visuels web et print pensés pour marquer les esprits, en alliant sens esthétique, rigueur technique et souci du détail. De l’identité visuelle à l’UX/UI design, je m’attache à donner vie à des supports cohérents et impactants, adaptés aux besoins des projets et des utilisateurs.\n\nPassion, exigence et envie d’apprendre me guident au quotidien. Curieux et motivé, j’aime relever de nouveaux défis, explorer les outils créatifs (Figma, WordPress, suite Adobe) et travailler en équipe pour faire émerger des projets qui ont du sens.');
/*!40000 ALTER TABLE `Profil` ENABLE KEYS */;
